<script>
    function sendToParent(type, value)  {
    let message = {};
    if(type === "year-sheng") {
        message = {
            "type": "updateMapByYearsheng",
            "yearsheng": value
        };
    } 
    window.parent.postMessage(message, '*');
    }
    // 为父元素添加事件代理
    document.body.addEventListener('click', function(event) {
    if (event.target.tagName === 'A') {
        event.preventDefault();
        if (event.target.hasAttribute('year-sheng')) {
            const yearsheng = event.target.getAttribute('year-sheng');
            sendToParent("year-sheng", yearsheng);
        } 
        }
    });
</script>
